import { Col, Container, Row, Form, Button, Alert } from "react-bootstrap";
import { Link } from "react-router-dom";
import logo from "../../img/Blue_Futuristic_Gaming_Logo-removebg-preview.png";
import { useSelector, useDispatch } from "react-redux";
import { useState, useEffect } from "react";
import { logInData } from "../../redux/actions";
import * as Icon from "react-bootstrap-icons";

const SignIn = () => {
  const [forgotPassword, setForgotPassword] = useState(false);

  const dispatch = useDispatch();

  const [check, setCheck] = useState(false);
  const [password, setPassword] = useState("");
  const isLoading = useSelector((state) => state.giftData.isLoading);
  const [email, setEmail] = useState("");

  const handlePassword = (e) => {
    setPassword(e.target.value);
    dispatch(logInData(loginFormData));
  };
  const handleEmail = (e) => {
    setEmail(e.target.value);
    dispatch(logInData(loginFormData));
  };

  const handleCheck = (e) => {
    check ? setCheck(false) : setCheck(true);
  };
  const handleForgetPassword = () => {
    setForgotPassword(true);
  };
  const loginFormData = {
    email: email,
    password: password,
    rememberSignIn: check,
  };
  return (
    <Container fluid className="login-page ">
      <Row className="giftcard-preview-nav py-2 ">
        <Col className="d-flex flex-column ml-5">
          <Link className="mr-auto" to={"/"}>
            <img className="logo-img " src={logo} alt="" />
          </Link>
          <span className="mr-auto textColor">LIVE EXPIRIENCE</span>
        </Col>
      </Row>
      <Row className="d-flex justify-content-center mt-4 textColor">
        <Col lg={4} className=" login-content">
          <div className=" ml-3 d-flex justify-content-between align-items-center">
            <h4>Sign In</h4>
            {forgotPassword && <h4>Forgot Password</h4>}
            <Link to={"/"}>
              <Icon.XLg size={20} className="textColor" />
            </Link>{" "}
          </div>
          <Link className="d-flex ml-3 mb-2" to={"/sign-up"}>
            or create an account
          </Link>
          <Alert variant="success">
            Account verification has been successfully completed
          </Alert>
          <hr />
          <Form.Group className="mb-4">
            <Col>
              {" "}
              <Form.Control
                type="email"
                placeholder=" Email"
                onChange={handleEmail}
              />
            </Col>
          </Form.Group>
          <Form.Group className="mb-4">
            <Col>
              <Form.Control
                type="password"
                placeholder=" Password"
                onChange={handlePassword}
                minLength={5}
              />
            </Col>
          </Form.Group>

          <Form.Group className="mb-3">
            <Col>
              <div className="d-flex align-items-center">
                <input
                  className="mr-2"
                  lavel="checkbox"
                  type="checkbox"
                  onClick={handleCheck}
                />
                <span id="checkbox">Remember me</span>
              </div>
            </Col>
          </Form.Group>
          <Col className=" d-flex mb-3 ">
            <Link to="/user-page" className="w-100">
              <Button
                disabled={!check || !email || !password}
                className="px-4 sign-up-btn w-100"
                variant="primary"
              >
                Sign in
              </Button>
            </Link>
          </Col>
          {forgotPassword && (
            <Col className=" d-flex mb-3 ">
              <Link to="" className="w-100">
                <Button
                  disabled={!email}
                  className="px-4 sign-up-btn w-100"
                  variant="primary"
                >
                  Send Reset Link
                </Button>
              </Link>
            </Col>
          )}
          <span className="mb-2">
            <strong>OR</strong>
          </span>
          <Col className=" d-flex mb-3 ">
            <a
              href={`${process.env.REACT_APP_BE_PROD_URL}/users/googleLogin`}
              className="w-100"
            >
              <Button className="px-4 sign-up-btn w-100" variant="primary">
                <Icon.Google size={20} />
                <span>Continue with Google</span>
              </Button>
            </a>
          </Col>
          <div className="mb-3">
            <span>
              <Link onClick={handleForgetPassword}>
                Forgotten your password
              </Link>
            </span>
          </div>
          {forgotPassword && (
            <div className="mb-3">
              <span>
                {" "}
                Back to!
                <Link>Login</Link>
              </span>
            </div>
          )}
        </Col>
      </Row>
    </Container>
  );
};
export default SignIn;
